import React from "react";
import { useEffect, useState } from "react"; 
import { Navigate } from 'react-router-dom';
import { jwtDecode } from 'jwt-decode';
import "./Cadastro.css";
//import logoWhite from "../assets/logoWhite.svg";
import button from "../assets/button.svg";

const Cadastro = () => {
  document.title = "Cadastro";
  const preventDrag = (e) => e.preventDefault();

  const [formData, setFormData] = useState({
    id: 1,
    username: '',
    email: '',
    password: '',
    address: '',
  });

  const dadosParaEnviar = {
    ...formData,
    createdAt: new Date().toISOString(),
    updatedAt: new Date().toISOString(),
    isSpecialClient: false,
    lastRun: new Date().toISOString()
  };

  const [mensagem, setMensagem] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const resposta = await fetch('http://localhost:8080/clients', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(dadosParaEnviar),
      });

      if (!resposta.ok) {
        throw new Error(`Erro: ${resposta.status}`);
      }

      const dados = await resposta;
      console.log('Resposta da API:', dados);
      setMensagem('Formulário enviado com sucesso!');
    } catch (erro) {
      console.error('Erro ao enviar:', erro);
      setMensagem('Ocorreu um erro ao enviar o formulário.');
    }
  };

  let flag = 'none';
  const token = localStorage.getItem("token");
  if(token) {
      const decodedToken = jwtDecode(token);
      flag = decodedToken.type;
  }

  if(flag!='none') {
    //if(flag=='admin') return (<Navigate to={{ pathname: '/admin' }} />);
    //if(flag=='carrocaboy') return (<Navigate to={{ pathname: '/carrocaBoy' }} />);
    //if(flag=='cashier') return (<Navigate to={{ pathname: '/cashier' }} />);
    if(flag=='client') return (<Navigate to={{ pathname: '/' }} />);
  } else {
    return (
      <div className="container">
        <div className="cell i1">
          <svg
            id="logo"
            className="logo"
            viewBox="0 0 516 976"
            xmlnssvg="http://www.w3.org/2000/svg"
            onDragStart={preventDrag}
          >
          </svg>
        </div>
        <div className="cell i2">
          {mensagem && <span style={{ color: "red" }}>{mensagem}</span>}
          <form onSubmit={handleSubmit}>
            <label>
              <input type="text" placeholder="Nome" id="username" name="username" value={FormData.username} onChange={handleChange} required />
            </label>
            <br />
            <label>
              <input type="email" placeholder="Email" id="email" name="email" value={FormData.email} onChange={handleChange} required />
            </label>
            <br />
            <label>
              <input type="password" placeholder="Senha" id="password" name="password" value={FormData.password} onChange={handleChange} required />
            </label>
            <br />
            <label>
              <input type="text" placeholder="Endereço" id="address" name="address" value={FormData.address} onChange={handleChange} />
            </label>
            <br />
            <label>
              <input type="submit" style={{ display: "none" }} />
              <svg
                id="button1"
                className="button"
                viewBox="0 0 251 44"
                xmlnssvg="http://www.w3.org/2000/svg"
                onDragStart={preventDrag}
              >
                <image href={button}/>
                <text
                  x="50%"
                  y="50%"
                  dominantBaseline="middle"
                  textAnchor="middle"
                  className="buttonText"
                >
                  Cadastrar
                </text>
              </svg>
            </label>
          </form>
        </div>
      </div>
    );
  }
};

export default Cadastro;
